import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axiosInstance from '../api/axiosConfig';
import '../styles/ListingDetails.css';
import Navbar from '../components/Navbar';

function ListingDetails() {
  const { id } = useParams();
  const [listing, setListing] = useState(null);
  const [photos, setPhotos] = useState([]);
  const [user, setUser] = useState(null);

  useEffect(() => {
    axiosInstance
      .get(`/api/listings/${id}`)
      .then((response) => {
        setListing(response.data.listing);
        setPhotos(response.data.photos);
        setUser(response.data.user);
      })
      .catch((error) => console.error('Error fetching listing details:', error));
  }, [id]);

  if (!listing) {
    return <div>Loading...</div>;
  }

  return (
    <div className="listing-details-container">
      <Navbar />
      <div className="listing-details-content">
        <div className="listing-images">
          {photos.length > 0 ? (
            <div className="image-slider">
              {photos.map((photo, index) => (
                <img
                  key={index}
                  src={`http://localhost:9000${photo.photo_url}`}
                  alt={`Listing photo ${index + 1}`}
                />
              ))}
            </div>
          ) : (
            <p>No images available</p>
          )}
        </div>
        <div className="listing-header">
          <h1>{listing.title}</h1>
          <p>
            {listing.address} {listing.building_name ? `| ${listing.building_name}` : ''}
          </p>
          <p>
            {listing.building_type} | {listing.bedrooms} bd | {listing.bathrooms} ba |{' '}
            {listing.availability}
          </p>
          <p>Posted by {user?.name}</p>
        </div>
        <div className="listing-overview">
          <h2>Overview</h2>
          <p>{listing.description}</p>
        </div>
        <div className="listing-amenities">
          <h2>Amenities</h2>
          <ul>
            {listing.amenities.split(',').map((amenity, index) => (
              <li key={index}>{amenity}</li>
            ))}
          </ul>
        </div>
        <div className="listing-fees">
          <h2>Fees and Policies</h2>
          <p>{listing.fees_policies}</p>
        </div>
        <div className="listing-leasing-terms">
          <h2>Leasing Terms</h2>
          <p>Type: {listing.lease_type}</p>
          <p>Duration: {listing.lease_from} to {listing.lease_to}</p>
          <p>Security Deposit: ${listing.security_deposit}</p>
        </div>
        <div className="contact-card">
          <h2>Contact</h2>
          <p>Name: {user?.name}</p>
          <p>Email: {user?.email}</p>
          <p>Phone: {user?.mobile_number}</p>
          <button onClick={() => console.log('Redirect to messaging feature')}>Message</button>
        </div>
      </div>
    </div>
  );
}

export default ListingDetails;
